    ss << v[i] << "x";
  ss << v[v.size() - 1];
  return ss.str();
}

int calculate_product(const std::vector<int64_t>& v) {
  int total = 1;
  for (auto& i : v) total *= i;
  return total;
}


void resizeimg(cv::Mat org,cv::Mat dst)
{
    int h = org.rows;
    int w = org.cols;

    float scale;
    int crnn_h = 32;
    int crnn_w_target;
    int crnn_h_target;
    scale = crnn_h*1.0/h;
    crnn_w_target = int(w * scale);

    resize(org,dst,Size(crnn_w_target,crnn_h));
    
